import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({

    containerModalLoading: {
        flex: 1,
        backgroundColor: 'rgba(51, 51, 51, 0.7)',
        justifyContent: "center",
        alignItems: "center",
    },

    modalLoadingText: {
        marginTop: 20,
        color: '#F0EFF4',
        fontSize: 15,
    }
});

export default styles;
